import React from "react";

const Nicholas = () => {
    return (
        <div>
            <img src="https://storage.googleapis.com/648-team4-pictures/nicholas.png" height="200"></img>
            <h1>Name: Nicholas Hamada</h1>
            <h1>Role: Frontend Manager</h1>
        </div>
    );
};

export default Nicholas;
